import React from 'react'

function Home({list}){
	return(
		<main>
			<table>
				<thead>
					<tr>번호</tr>
					<tr>제목</tr>
					<tr>작성자</tr>
					<tr>기능</tr>
				</thead>
			</table>
		</main>
	)
}

export default Home;
